   const changeTheme=()=>{
      let moonIcon = document.querySelector('.mo')
   }
    return (
       <section className="header_banner">
        <div className="header">
             <div className="header_title">
                <h3>Where in the world?</h3>

             </div>

             <div className="theme">
                <FaMoon onClick={changeTheme} className="moon"/>
                <h3 className="content">Dark Mode</h3>
             </div>

        </div>

   </section>

    )
}

export default Header
